function selectAnswers () {
    console.log('Day of year: ' + day);
    threeLetterAnswer = threeToFiveAnswerLibrary[day].word;
    if(threeToFiveAnswerLibrary[day].fitsInto.length > day) {
        fiveLetterAnswer = threeToFiveAnswerLibrary[day].fitsInto[day];
    }
    else if(threeToFiveAnswerLibrary[day].fitsInto.length > 7){
        fiveLetterAnswer = threeToFiveAnswerLibrary[day].fitsInto[now.getDay()];
    }
    else {
        fiveLetterAnswer = threeToFiveAnswerLibrary[day].fitsInto[0];
    }

    let index = fiveToSevenAnswerLibrary.map(function(e) { return e.word; }).indexOf(fiveLetterAnswer);

    if(fiveToSevenAnswerLibrary[index].fitsInto.length > day) {
        sevenLetterAnswer = fiveToSevenAnswerLibrary[index].fitsInto[day];
    }
    else if(fiveToSevenAnswerLibrary[index].fitsInto.length > 7){
        sevenLetterAnswer = fiveToSevenAnswerLibrary[index].fitsInto[now.getDay()];
    }
    else {
        sevenLetterAnswer = fiveToSevenAnswerLibrary[index].fitsInto[0];
    }
    
}

// Sequence of events
// 1. Word is entered
// 2. Word is validated
// 3. Row is animated
// 4. Results are stored
// 5. Next row, next word, or end screen

function evaluateButtonInput(buttonLetter) {
    let tile = getNextOpenSpace();
    let resultScreen = document.getElementById("results-overlay");
    
    if(inProgress) {
        return;
    }

    if(resultScreen.classList.contains("hide")){
        if (isLetter(buttonLetter)) {
            if(tile){
                tile.innerHTML = ` ${buttonLetter}`.trim().toUpperCase();
                tile.classList.remove("empty");
                tile.classList.add("filled");
                if(localStorage.getItem("colorTheme") == "light") {
                    tile.classList.add("light-letter");
                }
            }
        }
        if (buttonLetter.toLowerCase() == "del") {
            let tile = getLastFilledSpace();
            if(tile){
                tile.innerHTML = "";
                tile.classList.remove("filled");
                tile.classList.add("empty");
            }
        }
        if (buttonLetter.toLowerCase() == "") {
            if (rowIsFilled()) {
                evaluateWord();
            }
        }
    }
}

function evaluateKeebInput(event) {
    let tile = getNextOpenSpace();
    let resultScreen = document.getElementById("results-overlay");
    
    if(inProgress) {
        return;
    }

    if(resultScreen.classList.contains("hide")){
        if (isLetter(event.key)) {
            if(tile){
                tile.innerHTML = ` ${event.key}`.trim().toUpperCase();
                tile.classList.remove("empty");
                tile.classList.add("filled");
                if(localStorage.getItem("colorTheme") == "light") {
                    tile.classList.add("light-letter");
                }
            }
        }
        if (event.key.toLowerCase() == "backspace") {
            let tile = getLastFilledSpace();
            if(tile) {
                tile.innerHTML = "";
                tile.classList.remove("filled");
                tile.classList.add("empty");
            }
        }
        if (event.key.toLowerCase() == "enter" || event.key.toLowerCase() == "return") {
            if (rowIsFilled()) {
                evaluateWord();
            }
        }
    }
}

function isLetter(letter) {
    return letter.length === 1 && letter.match(/[a-z]/i);
}

function getNextOpenSpace() {
    let activeRow = document.getElementsByClassName("active");
    let activeChildren;
    if(activeRow.length > 0){
        activeChildren = activeRow[0].children;
        for (let child of activeChildren) {
            if (child.classList.value.includes("empty")) {
                return child;
            }
        }
    }
}

function getLastFilledSpace() {
    let activeRow = document.getElementsByClassName("active");
    let activeChildren;
    if(activeRow.length > 0){
        activeChildren = activeRow[0].children;
        for (let i = activeChildren.length - 1; i >= 0; i--) {
            if (activeChildren[i].classList.value.includes("filled")) {
                return activeChildren[i];
            }
        }
    }
}

function rowIsFilled() {
    let activeRow = document.getElementsByClassName("active");
    let activeChildren = activeRow[0].children;
    for (let child of activeChildren) {
        if (child.classList.value.includes("empty")) {
            return false;
        }
    }
    return true;
}

function isWordValid(word) {
    if (word.length == 3) {
        if (threeLetterWords.includes(word)) {
            return true;
        }
    }
    if (word.length == 5) {
        if (fiveLetterWords.includes(word)) {
            return true;
        }
    }
    else {
        if (sevenLetterWords.includes(word)) {
            return true;
        }
    }
    return false;
}

function isWordValidHard(word) {
    let activeRow = document.getElementsByClassName("active")[0];
    let previousRow = activeRow.previousSibling;
    let keyboard = document.getElementById("keyboard");
    let requiredLetters = [];

    let checkWord = word.split('');

    if(!previousRow.classList.contains("game-row") && activeRow.children.length == 3) {
        return true;
    }

    for(let row of keyboard.children){
        for(let letter of row.children) {
            if(letter.classList.contains("sorta") || letter.classList.contains("right")) {
                requiredLetters.push(letter.innerText.toLowerCase());
            }
        }
    }

    return requiredLetters.every(r => checkWord.includes(r));
}

function sortResultArray(a, b) {
    if (a.index < b.index){
        return -1;
    }
    if (a.index > b.index){
        return 1;
    }
    return 0;
}

function evaluateWord() {

    localStorage.setItem("timeoutDay", day);

    let wordArray = [];
    let answerArray = [];
    let unusedAnswerLetters = [];
    let unusedGuessLetters = [];
    let unusedAnswerLettersString = "";
    let wordString = "";
    let answerString = "";
    let activeRow = document.getElementsByClassName("active")[0];
    let activeChildren = activeRow.children;
    let gameBoardChildren = document.getElementById("game-board").childNodes;
    let numberOfGuesses = Array.prototype.indexOf.call(gameBoardChildren, activeRow)

    switch (activeChildren.length) {
        case 3:
            answer = threeLetterAnswer;
            break;
        case 5:
            answer = fiveLetterAnswer;
            break;
        case 7:
            answer = sevenLetterAnswer;
            break;
        default:
            answer = threeLetterAnswer;
    }

    for (let i = 0; i < activeChildren.length; i++) {
        let letter = {
            text: activeChildren[i].innerHTML.toLowerCase(),
            index: i,
            used: 0
        };
        let answerLetter = {
            text: answer[i],
            index: i,
            used: 0
        }
        wordArray.push(letter);
        answerArray.push(answerLetter);
        wordString += letter.text;
        answerString += answerLetter.text;
    }

    if (isWordValid(wordString)) {

        if(localStorage.getItem("gameMode") == "hard") {
            if(!isWordValidHard(wordString)){
                popupAlert("hardModeRule");
                return;
            }
        }

        let rowResults = [];
        let tile = "";

        for (let i = 0; i < answerArray.length; i++) {
            if (wordArray[i].text == answerArray[i].text) {
                let keeb = document.querySelector('[data-key="' + wordArray[i].text + '"]');
                answerArray[i].used = 1;
                wordArray[i].used = 1;

                tile = {index: wordArray[i].index, text: wordArray[i].text, result: "right"};
                rowResults.push(tile);

                if(keeb.classList.contains("sorta")){
                    keeb.classList.remove("sorta");
                }
                if(keeb.classList.contains("wrong")){
                    keeb.classList.remove("wrong");
                }
                keeb.classList.add("right");
            }
        }

        for (let i = 0; i < answerArray.length; i++) {
            if (!answerArray[i].used) {
                unusedAnswerLetters.push(answerArray[i]);
                unusedAnswerLettersString += answerArray[i].text;
            }
            if (!wordArray[i].used) {
                unusedGuessLetters.push(wordArray[i]);
            }
        }

        while (unusedGuessLetters.length > 0) {

            let keeb = document.querySelector('[data-key="' + unusedGuessLetters[0].text + '"]');

            if (unusedAnswerLetters.find(letter => letter.text == unusedGuessLetters[0].text)) {

                let usedAnswerLetter = unusedAnswerLetters.find(letter => letter.text == unusedGuessLetters[0].text);

                tile = {index: unusedGuessLetters[0].index, text: unusedGuessLetters[0].text, result: "sorta"};
                rowResults.push(tile);

                if(!keeb.classList.contains("right")){
                    if(keeb.classList.contains("wrong")){
                        keeb.classList.remove("wrong");
                    }
                    keeb.classList.add("sorta");
                }
                if(!numberOfGuesses){
                    keeb.classList.add("sorta");
                }
                unusedAnswerLetters.splice(unusedAnswerLetters.indexOf(usedAnswerLetter), 1);
                unusedGuessLetters.splice(unusedGuessLetters[0], 1);
            }
            else {

                tile = {index: unusedGuessLetters[0].index, text: unusedGuessLetters[0].text, result: "wrong"};
                rowResults.push(tile);

                if(!keeb.classList.contains("right")){
                    if(!keeb.classList.contains("sorta")){
                        keeb.classList.add("wrong");
                    }
                }
                unusedGuessLetters.splice(unusedGuessLetters[0], 1);
            }
        }

        rowResults.sort(sortResultArray);
        animateRow(rowResults);
        
        inProgress = 1;

        if (isWordCorrect(rowResults)) {

            popupAlert("wordCorrect");

            storeResults(1, rowResults.length, rowResults);

            setTimeout(function(){

                if (rowResults.length == 3) {
                    advanceToNextLevel(5);
                    if(localStorage.getItem("gamesPlayed")){
                        localStorage.setItem("gamesPlayed", parseInt(localStorage.getItem("gamesPlayed")) + 1);
                    }
                    else {
                        localStorage.setItem("gamesPlayed", 1);
                    }
                }
                if (rowResults.length == 5) {
                    advanceToNextLevel(7);
                }
                if (rowResults.length == 7) {
                    document.getElementById("social").classList.toggle("hide");
                    createCountdown();
                    initializeStats();
                    localStorage.setItem("timeout", 1);
                    localStorage.setItem("gameInProgress", 0);
                    advanceToNextLevel("done");
                }

                captureGameState();

                inProgress = 0;
            }, 2500);
        }

        else {

            let timer = 0;

            storeResults(0, rowResults.length, rowResults);

            if(activeChildren.length == 3){
                timer = 1000;
            }
            if(activeChildren.length == 5) {
                timer = 1500;
            }
            if(activeChildren.length == 7) {
                timer = 2000;
            }

            if(activeChildren.length == 3 && numberOfGuesses == 7){
                popupAlert("threeLetterAnswer");
                timer = 2500;
            }
            if(activeChildren.length == 5 && numberOfGuesses == 6){
                popupAlert("fiveLetterAnswer");
                timer = 2500;
            }
            if(activeChildren.length == 7 && numberOfGuesses == 5){
                popupAlert("sevenLetterAnswer");
                timer = 2500;
            }

            setTimeout(function(){

                if (activeChildren.length == 3 && numberOfGuesses == 7) {

                    for(let i = 0; i<threeLetterAnswer.length; i++){
                        let keeb = document.querySelector('[data-key="' + threeLetterAnswer[i] + '"]');
                        keeb.classList.add("sorta");
                    }

                    localStorage.setItem("threeLetterWordCorrect", 0);
                    localStorage.setItem("threeLetterTries", "X");
                    if(localStorage.getItem("gamesPlayed")){
                        localStorage.getItem("gamesPlayed", parseInt(localStorage.getItem("gamesPlayed")) + 1);
                    }
                    else {
                        localStorage.setItem("gamesPlayed", 1);
                    }
                    
                    advanceToNextLevel(5);
                    
                }
                else if (activeChildren.length == 5 && numberOfGuesses == 6) {
                    
                    for(let i = 0; i<fiveLetterAnswer.length; i++){
                        let keeb = document.querySelector('[data-key="' + fiveLetterAnswer[i] + '"]');
                        keeb.classList.add("sorta");
                    }
                    
                    localStorage.setItem("fiveLetterWordCorrect", 0);
                    localStorage.setItem("fiveLetterTries", "X");

                    advanceToNextLevel(7);
                }
                else if (activeChildren.length == 7 && numberOfGuesses == 5) {
                    localStorage.setItem("sevenLetterWordCorrect", 0);
                    localStorage.setItem("sevenLetterTries", "X");
                    document.getElementById("social").classList.toggle("hide");
                    createCountdown();
                    initializeStats();
                    localStorage.setItem("timeout", 1);
                    localStorage.setItem("gameInProgress", 0);
                    advanceToNextLevel("done");
                }

                else{
                    advanceToNextRow();
                }

                captureGameState();

                inProgress = 0;
                
            }, timer);
        }        
    }

    else {
        popupAlert("wordNotInList");
    }
}

function popupAlert(type) {
    let popupText = document.getElementById("small-pop-up-text");
    switch(type){
        case "wordNotInList":
            popupText.innerText = "Word not in list!";
            break;
        case "clipboardCopy":
            popupText.innerText = "Results copied to clipboard!";
            break;
        case "wordCorrect":
            let index = Math.floor(Math.random(correctWordQuips.length));
            popupText.innerText = correctWordQuips[index];
            correctWordQuips.splice(index, 1);
            break;
        case "threeLetterAnswer":
            popupText.innerHTML = "The answer was <span style='font-weight: bold;'>" + threeLetterAnswer.toUpperCase() + "</span>";
            break;
        case "fiveLetterAnswer":
            popupText.innerHTML = "The answer was <span style='font-weight: bold;'>" + fiveLetterAnswer.toUpperCase() + "</span>";
            break;
        case "sevenLetterAnswer":
            popupText.innerHTML = "The answer was <span style='font-weight: bold;'>" + sevenLetterAnswer.toUpperCase() + "</span>";
            break;
        case "hardModeStop":
            popupText.innerHTML = "Hard mode can only be enabled at the start of the game!";
            break;
        case "hardModeRule":
            popupText.innerHTML = "You must include all previously revealed letters!";
            break;
        default:
            popupText.innerText = "You shouldn't see this...";
    }

    let popupWrap = document.getElementById("small-pop-up-wrap");
    popupWrap.classList.toggle("hide");
    popupWrap.classList.toggle("fade-in");
    setTimeout(function(){
        popupWrap.classList.toggle("fade-in");
        popupWrap.classList.toggle("fade-out");
    },1500);
    setTimeout(function(){
        popupWrap.classList.toggle("fade-out");
        popupWrap.classList.toggle("hide");
    }, 1950);

}

function captureGameState() {
    let gameBoard = document.getElementById("game-board");
    let keyboard = document.getElementById("keyboard");
    localStorage.setItem("gameBoard", gameBoard.innerHTML);
    localStorage.setItem("keyboard", keyboard.innerHTML);
}

function storeResults(wordIsCorrect, wordLength, rowResults) {
    let guessString = "";
    let guessArray = [];
    let resultString = "";
    let resultArray = [];
    let tilesString = "";
    let tilesArray = [];

    if(localStorage.getItem("gameInProgress") == 1) {
        guessArray = localStorage.getItem("guesses").split(",");
        resultArray = localStorage.getItem("results").split(",");
        tilesArray = localStorage.getItem("tiles").split(",");
    }

    rowResults.forEach(letter => {

        let text = letter.text;
        let result = letter.result;

        guessString += text;

        if(result == "right") {
            resultString += "";
            tilesString += "r";
        }

        if(result == "sorta") {
            resultString += "";
            tilesString += "s";
        }

        if(result == "wrong") {
            resultString += "";
            tilesString += "w";
        }
    });

    if(guessArray.length > 0 && guessArray[guessArray.length-1].length != guessString.length){
        guessArray = [];
        tilesArray = [];
    }

    guessArray.push(guessString);
    tilesArray.push(tilesString);
    resultArray.push(resultString + "\n");

    if(isWordCorrect(rowResults)){
        if(wordLength == 3) {
            resultArray.push("\n");
            lifeThreeLetters = localStorage.getItem("lifetimeThreeLetterWords");
            localStorage.setItem("threeLetterWordCorrect", 1);
            localStorage.setItem("threeLetterTries", guessArray.length);
            if(lifeThreeLetters){
                lifeThreeLetters = parseInt(lifeThreeLetters) + 1;
                localStorage.setItem("lifetimeThreeLetterWords", lifeThreeLetters);
            }
            else{
                localStorage.setItem("lifetimeThreeLetterWords", 1);
            }
        }
        if(wordLength == 5) {
            resultArray.push("\n");
            lifeFiveLetters = localStorage.getItem("lifetimeFiveLetterWords");
            localStorage.setItem("fiveLetterWordCorrect", 1);
            localStorage.setItem("fiveLetterTries", guessArray.length);
            if(lifeFiveLetters){
                lifeFiveLetters = parseInt(lifeFiveLetters) + 1;
                localStorage.setItem("lifetimeFiveLetterWords", lifeFiveLetters);
            }
            else{
                localStorage.setItem("lifetimeFiveLetterWords", 1);
            }
        }
        if(wordLength == 7) {
            lifeSevenLetters = localStorage.getItem("lifetimeSevenLetterWords");
            localStorage.setItem("sevenLetterWordCorrect", 1);
            localStorage.setItem("sevenLetterTries", guessArray.length);
            if(lifeSevenLetters){
                lifeSevenLetters = parseInt(lifeSevenLetters) + 1;
                localStorage.setItem("lifetimeSevenLetterWords", lifeSevenLetters);
            }
            else{
                localStorage.setItem("lifetimeSevenLetterWords", 1);
            }
        }
    }

    else if((guessString.length == 3 && guessArray.length == 7) || (guessString.length == 5 && guessArray.length == 6)){
        resultArray.push("\n");
    }

    localStorage.setItem("results", resultArray);
    localStorage.setItem("guesses", guessArray);
    localStorage.setItem("tiles", tilesArray);
    localStorage.setItem("gameInProgress", 1);
    console.log(localStorage.getItem("results").trim().replaceAll(',',''));
    console.log(localStorage.getItem("guesses").trim());
}

function resetButtonKeeb(){
    let buttonKeebRows = document.getElementById("keyboard").children;
    for(let i=0; i<buttonKeebRows.length; i++){
        for(let j=0; j<buttonKeebRows[i].children.length; j++) {
            if(buttonKeebRows[i].children[j].classList.contains("right")){
                buttonKeebRows[i].children[j].classList.remove("right");
                buttonKeebRows[i].children[j].classList.add("sorta");
            }
            if(buttonKeebRows[i].children[j].classList.contains("wrong")){
                buttonKeebRows[i].children[j].classList.remove("wrong");
            }
        }
    }
}

function advanceToNextRow() {
    let allRows = document.getElementById("game-board").children;
    for (let i = 0; i < allRows.length; i++) {
        if (allRows[i].classList.contains("active")) {
            allRows[i].classList.remove("active");
            allRows[i].classList.add("filled");
            allRows[i + 1].classList.add("active");
            break;
        }
    }
}

function advanceToNextLevel(numberOfLetters) {
    switch (numberOfLetters) {
        case 5:
            resetButtonKeeb();
            buildBoard(5, 0);
            return;
        case 7:
            resetButtonKeeb();
            buildBoard(7, 0);
            return;
        case "done":
            document.getElementById("results-overlay").classList.toggle("hide");
            break;
    }
}

function isWordCorrect(rowResults) {
    for (let child of rowResults) {
        if (child.result != "right") {
            return false;
        }
    }
    return true;
}

