function changeColorTheme(themeSetting) {
    let pageBody = document.getElementById("page-body");
    let settingsOverlay = document.getElementById("settings-overlay");
    let settingsText = document.getElementsByClassName("settings-option");
    let settingsTitle = document.getElementById("settings-title");
    let links = document.getElementsByTagName("a");
    let closeButtons = document.getElementsByClassName("close-button");
    let existingLetters = document.getElementsByClassName("letter");
    let keebButtons = document.getElementsByClassName("keebButton");
    let rights = document.getElementsByClassName("right");
    let sortas = document.getElementsByClassName("sorta");
    let wrongs = document.getElementsByClassName("wrong");
    let results = document.getElementById("results");
    let header = document.getElementById("header");

    if(themeSetting == "light"){
        for(let text of settingsText) {
            text.children[0].classList.add("light-background-text");
        }

        for(let link of links) {
            link.style.color = "#000";
        }

        for (let closeButton of closeButtons) {
            closeButton.classList.remove("light-close-button");
            closeButton.classList.add("dark-close-button");
        }

        for (let letter of existingLetters) {
            letter.classList.add("light-letter");
        }

        for (let keebButton of keebButtons) {
            keebButton.classList.add("light-keebButton");
        }

        for (let right of rights) {
            right.classList.add("light-right");
        }

        for (let sorta of sortas) {
            sorta.classList.add("light-sorta");
        }

        for (let wrong of wrongs) {
            wrong.classList.add("light-wrong");
        }

        settingsOverlay.classList.add("light-background")
        pageBody.classList.add("light-background");
        settingsTitle.classList.add("light-background-text");
        results.classList.add("light-results");
        header.classList.add("header-light");
    }

    else{
        for(let text of settingsText) {
            text.children[0].classList.remove("light-background-text");
        }

        for(let link of links) {
            link.style.color = "#fff";
        }

        for (let closeButton of closeButtons) {
            closeButton.classList.add("light-close-button");
            closeButton.classList.remove("dark-close-button");
        }

        for (let letter of existingLetters) {
            letter.classList.remove("light-letter");
        }

        for (let keebButton of keebButtons) {
            keebButton.classList.remove("light-keebButton");
        }

        for (let right of rights) {
            right.classList.remove("light-right");
        }

        for (let sorta of sortas) {
            sorta.classList.remove("light-sorta");
        }

        for (let wrong of wrongs) {
            wrong.classList.remove("light-wrong");
        }

        settingsOverlay.classList.remove("light-background")
        pageBody.classList.remove("light-background");
        settingsTitle.classList.remove("light-background-text");
        results.classList.remove("light-results");
        header.classList.remove("header-light");
    }
}

