function getExistingGuesses() {
    if(localStorage.getItem("guesses")){
        let guessArray = localStorage.getItem("guesses").split(",");
        let colorArray = localStorage.getItem("tiles").split(",");
        let existingGuessDictionary = {
            numberOfGuesses: 0,
            guessStrings: [],
            colorStrings: []
        }
        guessArray.forEach(guess => {
            if(guess != "\n"){
                guess.trim();
                guess.replace(",","");
                existingGuessDictionary.guessStrings.push(guess);
                existingGuessDictionary.numberOfGuesses += 1;
            }
        })
        colorArray.forEach(color => {
            if(color != "\n"){
                color.trim();
                color.replace(",","");
                existingGuessDictionary.colorStrings.push(color);
            }
        })
        console.log("Number of words guessed: " + existingGuessDictionary.numberOfGuesses);
        console.log("Words guessed: " + existingGuessDictionary.guessStrings);
        console.log("Corresponding colors: " + existingGuessDictionary.colorStrings);

        return existingGuessDictionary;
    }
    else{
        let existingGuessDictionary = {
            numberOfGuesses: 0,
            guessStrings: [],
            colorStrings: []
        }
        return existingGuessDictionary;
    }
}

function createCountdown(){
    let timer=document.getElementById("timeout-counter");
 
    setInterval(function(){ 
        let toDate=new Date();
        let tomorrow=new Date();
        tomorrow.setHours(24,0,0,0);
        let diffMS=tomorrow.getTime()/1000-toDate.getTime()/1000;
        let diffHr=Math.floor(diffMS/3600);
        diffMS=diffMS-diffHr*3600;
        let diffMi=Math.floor(diffMS/60);
        diffMS=diffMS-diffMi*60;
        let diffS=Math.floor(diffMS);
        var result=((diffHr<10)?"0"+diffHr:diffHr);
        result+=":"+((diffMi<10)?"0"+diffMi:diffMi);
        result+=":"+((diffS<10)?"0"+diffS:diffS);
        timer.innerHTML=result;
    },1000);
}

