function initializeGameInProgress() {
    let existingGuesses = getExistingGuesses();
    let existingGuessWordLength = existingGuesses.guessStrings[existingGuesses.guessStrings.length-1].length;
    let existingTiles = localStorage.getItem("tiles").split(",");
    if (existingGuessWordLength == 3) {
        if(existingGuesses.guessStrings.length == 7 || existingTiles[existingTiles.length-1] == "rrr"){
            buildBoard(5, 1, 0);
        }
        else{
            buildBoard(existingGuessWordLength, 1, 0);
        }
    }
    if (existingGuessWordLength == 5) {
        if(existingGuesses.guessStrings.length == 6 || existingTiles[existingTiles.length-1] == "rrrrr"){
            buildBoard(7, 1, 0);
        }
        else{
            buildBoard(existingGuessWordLength, 1, 0);
        }
    }
    if (existingGuessWordLength == 7) {
        if(existingGuesses.guessStrings.length == 5 || existingTiles[existingTiles.length-1] == "rrrrrrr"){
            buildBoard(7, 1, 1);
        }
        else{
            buildBoard(existingGuessWordLength, 1, 0);
        }
    }
}

